var p={computed:{createPagesArray(e,r){const a=[...e],t=[];do{const s=a.splice(0,r);t.push(s)}while(a.length>0);return t},pagesAmount(){return this.pagesArray.length},pageNumber(){return parseInt(this.$route.params.pageNumber)||1}},methods:{checkRoutePageNumber(){if(this.pagesAmount&&this.pageRouteName){const e=this.$route.params.pageNumber;(!e||e<1)&&this.$router.push({name:this.pageRouteName,params:{pageNumber:1}}),e>this.pagesAmount&&this.$router.push({name:this.pageRouteName,params:{pageNumber:this.pagesAmount}})}},setPage(e){this.$router.push({name:this.pageRouteName,params:{pageNumber:e}})}},watch:{pageNumber(){this.checkRoutePageNumber()},pagesArray(e){e.length>0&&this.checkRoutePageNumber()}}};export{p};
